import NewProduct from "../home/NewProduct";
import BestSeller from '../home/BestSeller'
const Home = () => {
  return (

    <div>
      <img src="https://images.unsplash.com/photo-1517436073-3b1b1b1b1b1b?ixid=MnwxMjA3fDB8MHxzZWFyY2h8Mnx8YmVzdCUyMHNlbGxlcnxlbnwwfHwwfHw%3D&ixlib=rb-1.2.1&w=1000&q=80" alt="banner" className="img-fluid" />
      {/* New Product */}
      <h4 
      className="text-center p-3 mt-5 mb-5 display-4 jumbotron">
          สินค้ามาใหม่
       </h4>
         <NewProduct />   





      {/* Best Seller */}
      <h4 
      className="text-center p-3 mt-5 mb-5 display-4 jumbotron">
          สินค้าขายอย่างดี
       </h4>
        <BestSeller />

    </div>
  );
};

export default Home;
